import React, { useState } from 'react';
import { Anomaly } from '../types/insights';
import { AlertTriangle, TrendingUp, GitBranch, Zap, ChevronDown, ChevronRight, Filter, Search } from 'lucide-react';

interface AnomaliesTableProps {
  anomalies: Anomaly[];
}

const AnomaliesTable: React.FC<AnomaliesTableProps> = ({ anomalies }) => {
  const [expandedRows, setExpandedRows] = useState<Set<string>>(new Set());
  const [filterSeverity, setFilterSeverity] = useState<string>('all');
  const [filterType, setFilterType] = useState<string>('all');
  const [searchQuery, setSearchQuery] = useState<string>('');
  const [groupSimilar, setGroupSimilar] = useState<boolean>(false);

  const toggleRow = (id: string) => {
    const newExpanded = new Set(expandedRows);
    if (newExpanded.has(id)) {
      newExpanded.delete(id);
    } else {
      newExpanded.add(id);
    }
    setExpandedRows(newExpanded);
  };

  const getSeverityColor = (severity: string) => {
    switch (severity) {
      case 'critical': return 'badge-error';
      case 'high': return 'badge-warning';
      case 'medium': return 'badge-primary';
      case 'low': return 'badge-success';
      default: return 'badge-neutral';
    }
  };

  const getTypeIcon = (type: string) => {
    switch (type) {
      case 'burst_correlation': return <Zap className="h-4 w-4" />;
      case 'lead_lag': return <TrendingUp className="h-4 w-4" />;
      case 'pmi_correlation': return <GitBranch className="h-4 w-4" />;
      case 'change_attribution': return <AlertTriangle className="h-4 w-4" />;
      default: return <AlertTriangle className="h-4 w-4" />;
    }
  };

  const getTypeColor = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'text-primary-600';
      case 'lead_lag': return 'text-success-600';
      case 'pmi_correlation': return 'text-secondary-600';
      case 'change_attribution': return 'text-accent-600';
      default: return 'text-neutral-600';
    }
  };

  const formatTypeLabel = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'Burst Correlation';
      case 'lead_lag': return 'Lead-Lag';
      case 'pmi_correlation': return 'PMI Co-occurrence';
      case 'change_attribution': return 'Change Attribution';
      default: return type;
    }
  };

  const filteredAnomalies = anomalies.filter(anomaly => {
    const severityMatch = filterSeverity === 'all' || anomaly.severity === filterSeverity;
    const typeMatch = filterType === 'all' || anomaly.type === filterType;
    const searchMatch = searchQuery === '' || 
      anomaly.message.toLowerCase().includes(searchQuery.toLowerCase()) ||
      anomaly.id.toLowerCase().includes(searchQuery.toLowerCase());
    return severityMatch && typeMatch && searchMatch;
  });

  const renderDetails = (anomaly: Anomaly) => {
    const details = anomaly.details;

    switch (anomaly.type) {
      case 'burst_correlation':
        return (
          <div className="space-y-6">
            {/* Primary Metrics */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="bg-gradient-to-br from-primary-50 to-primary-100 rounded-xl p-4 border border-primary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-primary-700">Correlation</span>
                  <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">R</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-primary-900">{details.correlation?.toFixed(3)}</div>
                <div className="text-xs text-primary-600 mt-1">Pearson Correlation</div>
              </div>

              <div className="bg-gradient-to-br from-warning-50 to-warning-100 rounded-xl p-4 border border-warning-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-warning-700">P-value</span>
                  <div className="w-8 h-8 bg-warning-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">P</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-warning-900">{details.p_value?.toExponential(2)}</div>
                <div className="text-xs text-warning-600 mt-1">Statistical Significance</div>
              </div>

              <div className="bg-gradient-to-br from-success-50 to-success-100 rounded-xl p-4 border border-success-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-success-700">Aligned Bursts</span>
                  <div className="w-8 h-8 bg-success-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">B</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-success-900">{details.aligned_bursts}</div>
                <div className="text-xs text-success-600 mt-1">Synchronized Events</div>
              </div>
            </div>

            {/* Detailed Metrics Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-primary-500 rounded-full mr-2"></div>
                  Statistical Analysis
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Sample Size:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.sample_size}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Total Buckets:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.total_buckets}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Burst Alignment Rate:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {((details.aligned_bursts / details.total_buckets) * 100)?.toFixed(1)}%
                    </span>
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-success-500 rounded-full mr-2"></div>
                  Confidence Metrics
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Confidence Interval:</span>
                    <span className="font-mono text-sm text-neutral-900">
                      [{details.confidence_interval?.[0]?.toFixed(3)}, {details.confidence_interval?.[1]?.toFixed(3)}]
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Significance Level:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.p_value < 0.001 ? 'Very High' : details.p_value < 0.01 ? 'High' : details.p_value < 0.05 ? 'Medium' : 'Low'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Correlation Strength:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {Math.abs(details.correlation) > 0.8 ? 'Very Strong' : Math.abs(details.correlation) > 0.6 ? 'Strong' : Math.abs(details.correlation) > 0.4 ? 'Moderate' : 'Weak'}
                    </span>
                  </div>
                </div>
              </div>
            </div>

            {/* Interpretation */}
            <div className="bg-gradient-to-r from-green-50 to-emerald-50 rounded-xl p-4 border border-green-200">
              <h5 className="text-sm font-semibold text-green-900 mb-2 flex items-center">
                <div className="w-2 h-2 bg-green-500 rounded-full mr-2"></div>
                Interpretation
              </h5>
              <p className="text-sm text-green-800">
                This burst correlation shows a {Math.abs(details.correlation) > 0.8 ? 'very strong' : Math.abs(details.correlation) > 0.6 ? 'strong' : 'moderate'} 
                temporal relationship with {details.aligned_bursts} synchronized events out of {details.total_buckets} total buckets. 
                The p-value of {details.p_value?.toExponential(2)} indicates {details.p_value < 0.001 ? 'very high' : details.p_value < 0.01 ? 'high' : 'moderate'} 
                statistical significance.
              </p>
            </div>
          </div>
        );

      case 'lead_lag':
        return (
          <div className="space-y-6">
            {/* Primary Metrics */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="bg-gradient-to-br from-primary-50 to-primary-100 rounded-xl p-4 border border-primary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-primary-700">Lag Time</span>
                  <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">L</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-primary-900">{details.lag_seconds}s</div>
                <div className="text-xs text-primary-600 mt-1">Time Delay</div>
              </div>

              <div className="bg-gradient-to-br from-success-50 to-success-100 rounded-xl p-4 border border-success-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-success-700">Direction</span>
                  <div className="w-8 h-8 bg-success-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">D</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-success-900 capitalize">{details.direction}</div>
                <div className="text-xs text-success-600 mt-1">Causal Flow</div>
              </div>

              <div className="bg-gradient-to-br from-secondary-50 to-secondary-100 rounded-xl p-4 border border-secondary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-secondary-700">Granger Score</span>
                  <div className="w-8 h-8 bg-secondary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">G</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-secondary-900">{details.granger_score?.toFixed(3)}</div>
                <div className="text-xs text-secondary-600 mt-1">Causality Test</div>
              </div>
            </div>

            {/* Detailed Metrics Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-primary-500 rounded-full mr-2"></div>
                  Temporal Analysis
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Correlation:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.correlation?.toFixed(3)}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Lag Strength:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {Math.abs(details.correlation) > 0.8 ? 'Very Strong' : Math.abs(details.correlation) > 0.6 ? 'Strong' : 'Moderate'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Time Window:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.lag_seconds < 60 ? `${details.lag_seconds}s` : `${(details.lag_seconds / 60).toFixed(1)}m`}
                    </span>
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-success-500 rounded-full mr-2"></div>
                  Statistical Confidence
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Confidence:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{(details.confidence * 100)?.toFixed(1)}%</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Significance:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.confidence > 0.95 ? 'Very High' : details.confidence > 0.8 ? 'High' : 'Medium'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Causality Level:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.granger_score > 0.8 ? 'Strong' : details.granger_score > 0.5 ? 'Moderate' : 'Weak'}
                    </span>
                  </div>
                </div>
              </div>
            </div>

            {/* Interpretation */}
            <div className="bg-gradient-to-r from-purple-50 to-violet-50 rounded-xl p-4 border border-purple-200">
              <h5 className="text-sm font-semibold text-purple-900 mb-2 flex items-center">
                <div className="w-2 h-2 bg-purple-500 rounded-full mr-2"></div>
                Interpretation
              </h5>
              <p className="text-sm text-purple-800">
                This lead-lag relationship shows a {details.direction} causal flow with a {details.lag_seconds}-second delay. 
                The Granger score of {details.granger_score?.toFixed(3)} indicates {details.granger_score > 0.8 ? 'strong' : 'moderate'} 
                causality, with {(details.confidence * 100)?.toFixed(1)}% confidence. This suggests that changes in one event 
                {details.direction === 'lead' ? 'precede' : 'follow'} changes in the other by {details.lag_seconds} seconds.
              </p>
            </div>
          </div>
        );

      case 'pmi_correlation':
        return (
          <div className="space-y-6">
            {/* Primary Metrics */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="bg-gradient-to-br from-primary-50 to-primary-100 rounded-xl p-4 border border-primary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-primary-700">PMI Score</span>
                  <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">PMI</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-primary-900">{details.pmi_score?.toFixed(2)}</div>
                <div className="text-xs text-primary-600 mt-1">Pointwise Mutual Information</div>
              </div>

              <div className="bg-gradient-to-br from-success-50 to-success-100 rounded-xl p-4 border border-success-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-success-700">Support</span>
                  <div className="w-8 h-8 bg-success-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">S</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-success-900">{details.support}</div>
                <div className="text-xs text-success-600 mt-1">Co-occurrence Count</div>
              </div>

              <div className="bg-gradient-to-br from-secondary-50 to-secondary-100 rounded-xl p-4 border border-secondary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-secondary-700">Confidence</span>
                  <div className="w-8 h-8 bg-secondary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">C</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-secondary-900">{(details.confidence * 100)?.toFixed(1)}%</div>
                <div className="text-xs text-secondary-600 mt-1">Statistical Confidence</div>
              </div>
            </div>

            {/* Detailed Metrics Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-primary-500 rounded-full mr-2"></div>
                  Statistical Metrics
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Total Buckets:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.total_buckets}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">PMI Raw Value:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.pmi_score?.toFixed(4)}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Support Ratio:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {((details.support / details.total_buckets) * 100)?.toFixed(2)}%
                    </span>
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-success-500 rounded-full mr-2"></div>
                  Quality Indicators
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Significance Level:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.confidence > 0.95 ? 'High' : details.confidence > 0.8 ? 'Medium' : 'Low'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">PMI Strength:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.pmi_score > 3 ? 'Very Strong' : details.pmi_score > 2 ? 'Strong' : details.pmi_score > 1 ? 'Moderate' : 'Weak'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Data Coverage:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {((details.support / details.total_buckets) * 100) > 10 ? 'Good' : 'Limited'}
                    </span>
                  </div>
                </div>
              </div>
            </div>

            {/* Interpretation */}
            <div className="bg-gradient-to-r from-blue-50 to-indigo-50 rounded-xl p-4 border border-blue-200">
              <h5 className="text-sm font-semibold text-blue-900 mb-2 flex items-center">
                <div className="w-2 h-2 bg-blue-500 rounded-full mr-2"></div>
                Interpretation
              </h5>
              <p className="text-sm text-blue-800">
                This PMI correlation indicates a {details.pmi_score > 3 ? 'very strong' : details.pmi_score > 2 ? 'strong' : 'moderate'} 
                co-occurrence pattern between the events. With {details.support} occurrences out of {details.total_buckets} total buckets 
                ({(details.support / details.total_buckets * 100)?.toFixed(1)}% coverage), this represents a statistically significant 
                relationship with {(details.confidence * 100)?.toFixed(1)}% confidence.
              </p>
            </div>
          </div>
        );

      case 'change_attribution':
        return (
          <div className="space-y-6">
            {/* Primary Metrics */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="bg-gradient-to-br from-primary-50 to-primary-100 rounded-xl p-4 border border-primary-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-primary-700">Correlation</span>
                  <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">R</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-primary-900">{details.correlation_coefficient?.toFixed(3)}</div>
                <div className="text-xs text-primary-600 mt-1">Change Correlation</div>
              </div>

              <div className="bg-gradient-to-br from-warning-50 to-warning-100 rounded-xl p-4 border border-warning-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-warning-700">Lag Time</span>
                  <div className="w-8 h-8 bg-warning-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">T</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-warning-900">{details.lag_minutes?.toFixed(1)}m</div>
                <div className="text-xs text-warning-600 mt-1">Time Delay</div>
              </div>

              <div className="bg-gradient-to-br from-success-50 to-success-100 rounded-xl p-4 border border-success-200">
                <div className="flex items-center justify-between mb-2">
                  <span className="text-sm font-medium text-success-700">Change Events</span>
                  <div className="w-8 h-8 bg-success-500 rounded-lg flex items-center justify-center">
                    <span className="text-white text-xs font-bold">C</span>
                  </div>
                </div>
                <div className="text-2xl font-bold text-success-900">{details.change_count}</div>
                <div className="text-xs text-success-600 mt-1">Total Changes</div>
              </div>
            </div>

            {/* Detailed Metrics Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-primary-500 rounded-full mr-2"></div>
                  Change Analysis
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Effect Count:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">{details.effect_count}</span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Attribution Rate:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {((details.effect_count / details.change_count) * 100)?.toFixed(1)}%
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Correlation Strength:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {Math.abs(details.correlation_coefficient) > 0.8 ? 'Very Strong' : Math.abs(details.correlation_coefficient) > 0.6 ? 'Strong' : 'Moderate'}
                    </span>
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h5 className="text-sm font-semibold text-neutral-900 mb-3 flex items-center">
                  <div className="w-2 h-2 bg-success-500 rounded-full mr-2"></div>
                  Temporal Impact
                </h5>
                <div className="space-y-3">
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Lag Window:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.lag_minutes < 60 ? `${details.lag_minutes?.toFixed(1)}m` : `${(details.lag_minutes / 60)?.toFixed(1)}h`}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Change Frequency:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.change_count > 100 ? 'High' : details.change_count > 50 ? 'Medium' : 'Low'}
                    </span>
                  </div>
                  <div className="flex justify-between items-center py-2 px-3 bg-neutral-50 rounded-lg">
                    <span className="font-medium text-neutral-700">Impact Level:</span>
                    <span className="font-mono text-lg font-bold text-neutral-900">
                      {details.effect_count > 50 ? 'High' : details.effect_count > 20 ? 'Medium' : 'Low'}
                    </span>
                  </div>
                </div>
              </div>
            </div>

            {/* Interpretation */}
            <div className="bg-gradient-to-r from-orange-50 to-amber-50 rounded-xl p-4 border border-orange-200">
              <h5 className="text-sm font-semibold text-orange-900 mb-2 flex items-center">
                <div className="w-2 h-2 bg-orange-500 rounded-full mr-2"></div>
                Interpretation
              </h5>
              <p className="text-sm text-orange-800">
                This change attribution analysis shows a {Math.abs(details.correlation_coefficient) > 0.8 ? 'very strong' : 'strong'} 
                correlation between changes and their effects, with a {details.lag_minutes?.toFixed(1)}-minute lag. 
                Out of {details.change_count} total changes, {details.effect_count} resulted in measurable effects 
                ({(details.effect_count / details.change_count * 100)?.toFixed(1)}% attribution rate). This suggests a 
                {details.lag_minutes < 30 ? 'short-term' : 'medium-term'} causal relationship between the events.
              </p>
            </div>
          </div>
        );

      default:
        return (
          <div className="bg-neutral-50 rounded-lg p-4">
            <pre className="text-sm text-neutral-700 overflow-auto">
              {JSON.stringify(details, null, 2)}
            </pre>
          </div>
        );
    }
  };

  return (
    <div className="space-y-6">
      {/* Filters and Search */}
      <div className="card">
        <div className="card-header">
          <div className="flex items-center gap-2">
            <Filter className="w-5 h-5 text-neutral-600" />
            <h3 className="card-title">Filter Anomalies</h3>
          </div>
          <div className="text-sm text-neutral-500">
            {filteredAnomalies.length} of {anomalies.length} anomalies
          </div>
        </div>
        <div className="card-content">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Search</label>
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-neutral-400" />
                <input
                  type="text"
                  placeholder="Search anomalies..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
                />
              </div>
            </div>

            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Severity Level</label>
              <select
                value={filterSeverity}
                onChange={(e) => setFilterSeverity(e.target.value)}
                className="w-full px-3 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
              >
                <option value="all">All Severities</option>
                <option value="critical">Critical</option>
                <option value="high">High</option>
                <option value="medium">Medium</option>
                <option value="low">Low</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Anomaly Type</label>
              <select
                value={filterType}
                onChange={(e) => setFilterType(e.target.value)}
                className="w-full px-3 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
              >
                <option value="all">All Types</option>
                <option value="burst_correlation">Burst Correlation</option>
                <option value="lead_lag">Lead-Lag</option>
                <option value="pmi_correlation">PMI Co-occurrence</option>
                <option value="change_attribution">Change Attribution</option>
              </select>
            </div>
          </div>
        </div>
      </div>

      {/* Table */}
      <div className="table-container">
        <table className="table">
          <thead>
            <tr>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Anomaly Details
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Type
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Severity
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Detected
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody>
            {filteredAnomalies.map((anomaly, index) => (
              <React.Fragment key={anomaly.id}>
                <tr className="hover:bg-neutral-50 transition-colors">
                  <td className="px-6 py-4">
                    <div className="flex items-start space-x-3">
                      <div className="flex-shrink-0 mt-1">
                        <AlertTriangle className="h-5 w-5 text-error-500" />
                      </div>
                      <div className="min-w-0 flex-1">
                        <div className="text-sm font-medium text-neutral-900 mb-1">
                          {anomaly.message}
                        </div>
                        <div className="text-xs text-neutral-500 space-y-1">
                          <div>ID: {anomaly.id}</div>
                          {anomaly.type === 'change_attribution' && anomaly.details && (
                            <div className="text-xs text-neutral-600 bg-neutral-100 px-2 py-1 rounded">
                              <span className="font-medium">Source:</span> {anomaly.details.change_series?.split('/').pop() || 'Unknown'} → 
                              <span className="font-medium"> Target:</span> {anomaly.details.effect_series?.split('/').pop() || 'Unknown'}
                            </div>
                          )}
                        </div>
                      </div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className={`flex items-center space-x-2 ${getTypeColor(anomaly.type)}`}>
                      {getTypeIcon(anomaly.type)}
                      <span className="text-sm font-medium">
                        {formatTypeLabel(anomaly.type)}
                      </span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`badge ${getSeverityColor(anomaly.severity)}`}>
                      {anomaly.severity.toUpperCase()}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm text-neutral-900">
                      {new Date(anomaly.timestamp).toLocaleTimeString()}
                    </div>
                    <div className="text-xs text-neutral-500">
                      {new Date(anomaly.timestamp).toLocaleDateString()}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <button
                      onClick={() => toggleRow(anomaly.id)}
                      className="btn btn-secondary text-sm"
                    >
                      {expandedRows.has(anomaly.id) ? (
                        <>
                          <ChevronDown className="h-4 w-4 mr-1" />
                          Hide Details
                        </>
                      ) : (
                        <>
                          <ChevronRight className="h-4 w-4 mr-1" />
                          View Details
                        </>
                      )}
                    </button>
                  </td>
                </tr>
                {expandedRows.has(anomaly.id) && (
                  <tr className="bg-neutral-50">
                    <td colSpan={5} className="px-6 py-6">
                      <div className="bg-white rounded-lg p-6 border border-neutral-200">
                        <h4 className="text-sm font-semibold text-neutral-900 mb-4">Technical Details</h4>
                        {renderDetails(anomaly)}
                      </div>
                    </td>
                  </tr>
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>

        {filteredAnomalies.length === 0 && (
          <div className="text-center py-12">
            <div className="w-16 h-16 bg-neutral-100 rounded-full flex items-center justify-center mx-auto mb-4">
              <AlertTriangle className="h-8 w-8 text-neutral-400" />
            </div>
            <h3 className="text-lg font-medium text-neutral-900 mb-2">No Anomalies Found</h3>
            <p className="text-neutral-500">
              No anomalies match the current filter criteria.
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default AnomaliesTable;
